function parsingData(i){
  var dataList = {
    time:awsData[i].event.timestamp,
    sourceIp : awsData[i].event.src_ip,
    sourcePort : awsData[i].event.src_port,
    destIp : awsData[i].event.dest_ip,
    destPort : awsData[i].event.dest_port,
    eventType : awsData[i].event.event_type,
    };
  
    return dataList;
}
  

